import * as React from 'react';
import Box from '@mui/material/Box';
import { Button, Typography } from '@mui/material';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      bgcolor="#424242"
      height={250}
      width={300}
      my={5}
      display="flex"
      flexDirection="column"
      justifyContent="space-between"
      gap={2}
      p={2}
      borderRadius={3}
    >
    <Box>
      
    </Box>
    <Typography
      textAlign="center"
      color="#fff"
    >
      {job.title}
    </Typography>
    <Typography
      color="#fff"
    >
      {job.description}
    </Typography>
    <Button
      variant="contained"
      sx={{
          backgroundColor: '#ff8f00',
          '&:hover': {
            backgroundColor: '#000', // Màu nền khi hover
          },
        }}
    >
      LEARN MORE
    </Button>
  </Box>
  );
}
